from itertools import count
from sympy import divisors
for a in count(2):
    q = divisors(a)[:-1]
    r = sum(q)
    if r > a or len(q) == 1:
        pass
    elif r == a:
        print(a)
    else:
        c = 1
        while r < a:
            q.append(r)
            r = sum(q[c:])
            c += 1
        if r == a:
            print(a)
